import logo from './logo.svg';
import './App.css';
import Header from './components/Header /Header ';
import Banner from './components/body/Banner';
import Footer from './components/Footer/Footer';
import Product from './components/body/Product';


function App() {
  return (
    <div className="App">
      <p Header/>
      <div>
        <Banner/>
        <Product/>


      </div>
      <Footer/>



    </div>
  );
}

export default App;
